import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';


function Componente(props) {
  console.log (props);

  const {titulo, contenido} = props
  return (
    <div>
      <h1>{titulo}</h1>
      <div>{contenido}</div>
    </div>
  );
}

ReactDOM.render(
  <Componente titulo="TITULO" contenido="contenido"/>,
  document.getElementById('root')
);
